import axios from "axios";
import { Button, Col, Container, Form, Row } from "react-bootstrap";
import { useNavigate } from "react-router-dom";

import { useState } from "react";

function AddAnimal({ apiURL, form, setForm }) {
  const navigate = useNavigate();
  const path = "/cadastrarAnimal";
  const url = `${apiURL}${path}`;

  const handleChange = (e) => {
    //monitoramento dos inputs
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post(`${apiURL}/cadastrarAnimal`, animal);
      // Limpa os campos do formulário após o envio bem-sucedido
      setAnimal({
        idAnimal: "",
        nome: "",
        idade: "",
        sexo: "",
        peso: "",
        raca: "",
        alergia: "",
        cor: "",
        especie: "",
        idCliente: ""
      });
      // Você pode adicionar uma mensagem de sucesso aqui, se desejar
    } catch (error) {
      console.error("Erro:", error);
      // Você pode adicionar um tratamento de erro aqui, se desejar
    }
  };

  const [animal, setAnimal] = useState({
    idAnimal: "",
    nome: "",
    idade: "",
    sexo: "",
    peso: "",
    raca: "",
    alergia: "",
    cor: "",
    especie: "",
    idCliente: "" // Adicionando o campo idCliente ao estado do animal
  });

  
  return (
    <Form onSubmit={handleSubmit}>
      <Form.Group controlId="formNome">
        <Form.Label>Nome</Form.Label>
        <Form.Control
          type="text"
          name="nome"
          value={animal.nome}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formIdade">
        <Form.Label>Idade</Form.Label>
        <Form.Control
          type="text"
          name="idade"
          value={animal.idade}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formSexo">
        <Form.Label>Sexo</Form.Label>
        <Form.Control
          type="text"
          name="sexo"
          value={animal.sexo}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formPeso">
        <Form.Label>Peso</Form.Label>
        <Form.Control
          type="text"
          name="peso"
          value={animal.peso}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formRaca">
        <Form.Label>Raça</Form.Label>
        <Form.Control
          type="text"
          name="raca"
          value={animal.raca}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formAlergia">
        <Form.Label>Alergia</Form.Label>
        <Form.Control
          type="text"
          name="alergia"
          value={animal.alergia}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formCor">
        <Form.Label>Cor</Form.Label>
        <Form.Control
          type="text"
          name="cor"
          value={animal.cor}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formEspecie">
        <Form.Label>Espécie</Form.Label>
        <Form.Control
          type="text"
          name="especie"
          value={animal.especie}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formIdCliente">
        <Form.Label>ID do Cliente</Form.Label>
        <Form.Control
          type="text"
          name="idCliente"
          value={animal.idCliente}
          onChange={handleChange}
        />
      </Form.Group>
      <Button
          variant="secondary"
          onClick={() => navigate(-1)}
          style={{ margin: "10px" }}
        >
          Voltar
        </Button>
      <Button variant="primary" type="submit">
        Enviar
      </Button>
      <p />
    </Form>

  );
}
    

export default AddAnimal;
